//React
import React, { useState } from 'react'
//CSS
import './Header.css';
import './accountDropDown/AccountDropDown.css';

//Assets
import logo from '../../assets/logo.png';

//Components
import AccountDropDown from './accountDropDown/AccountDropDown';

const Header = () => {
    const [sidebarIsOpen, setSidebarIsOpen] = useState(false)


    return (
        <div className='header_container'>
            <div className='accountdropdown_container'>
            <div className='header'>
                <div className='header_left'>
                    Shocker Pools
                </div>
                <div className='header_middle'>
                    <div className='header_right_left'>
                        <ul>
                            <li><a>Pools</a></li>
                            <li><a>Hot Tubs</a></li>
                            <li><a>Chemicals</a></li>
                            <li><a>Furniture</a></li>
                            <li><a>Grills</a></li>
                            <li><a>Services</a></li>
                        </ul>
                    </div>
                </div>
                <div className='header_right'>
                    <div className='header_right_right'>
                        <ul>
                            <li onClick={() => setSidebarIsOpen(!sidebarIsOpen)}><a>Account</a></li>
                        </ul>
                        
                    </div>
                </div>
            </div>
            <AccountDropDown className={sidebarIsOpen ? "dropdown_container" : "dropdown_container dropdown_container-close"} />
            </div>
        </div>
    );
}

export default Header;
